        <script>
            $(function() {
                $('.moment [data-moment=fromNow]').each(function() {
                    $(this).text(moment($(this).text()).fromNow());
                });
                $('.moment [data-moment=LLLL]').each(function() {
                    $(this).text(moment($(this).text()).format('LLLL') + ' ' + moment.tz(moment.tz.guess()).zoneAbbr());
                });
                $('.moment').removeClass('v-hidden');
            });
        </script>

        <script>
        function fetch_api(route, method, data) {
            let request = {
                method: method,
                body: JSON.stringify(data),
                credentials: "include",
                headers: {
                  'Content-Type': 'application/json',
                  'Time-Zone': moment.tz.guess()
                }
            };

            if (method == "GET") {
                if (data) {
                    route += "?" + new URLSearchParams(data).toString();
                }
                delete request.body;
            }

            return fetch(`/api${route}`, request);
        }

        function ajax(route, method, data, onSuccess, onError) {
            fetch_api(route, method, data).then(response => {
                if (!response.ok) {
                    response.json().then(res => {
                        error = res["error"] !== undefined ? res["error"] : "An unexpected error occured, please contact sysadmins@cs50.harvard.edu";
                        onError(error);
                    });
                } else {
                    response.json().then(onSuccess);
                }
            });
        }
        </script>
